import React from 'react';
import {BrowserRouter} from 'react-router-dom';
class FormRouting extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <header>
                    <div>
                    <div style = {{backgroundColor : "Yellow"}}>
                        <h2><center>Hello Form Using Router</center></h2>
                        </div>
                    </div>
                </header>
            </BrowserRouter>
        )
    }
}
export default FormRouting;
